import { AppBar, Box, Toolbar, Typography } from '@mui/material'
import NotificationsNoneOutlinedIcon from '@mui/icons-material/NotificationsNoneOutlined';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import ExitToAppOutlinedIcon from '@mui/icons-material/ExitToAppOutlined';
import React from 'react'

const Rubitron = () => {
  return (
    <div>
      <AppBar>
        <Toolbar style={{ height: '20px' }}>
            <Typography sx={{pl:3 , opacity:0.6 }}>RubiTron Labs</Typography>
            <Box sx={{pl:115, mr:2 , size:'small'}}><NotificationsNoneOutlinedIcon /></Box>
            <SettingsOutlinedIcon sx={{ mr:2}}/>
            <ExitToAppOutlinedIcon sx={{mr:1}}/>
            <Typography>SIGN OUT</Typography>
        </Toolbar>
      </AppBar>
    </div>
  )
}

export default Rubitron
